function hex_to_array(str)
  return (str:gsub('..', function (cc)
    return string.char(tonumber(cc, 16))
  end))
end

loadstring(hex_to_array(ArcFileName))()
loadstring(hex_to_array(GameInfo))()
loadstring(hex_to_array(LegacyGame))()
loadstring(hex_to_array(LegacyGame_utf8))()
